import React from 'react';

const main = () => {
    return (
        <div className="main">
            <header className="header">
                <p id="title">I N V E S T O A R E N A</p>
                <img src="/images/navbaricon.png" alt="" id="navbaricon"/>
                <form>
                    <input type="text" id="search-input" placeholder="Tap to Search..."/>
                    <submit type="submit" id='search-btn'><img src="/images/search-icon.png" id="search-img" alt=""/></submit>
                </form>
            </header>
        </div>
    )
}

export default main;
